<template>
  <div class="loadingCon" ref="loadingCon">
    <img v-if="currentWidth<1440" class="loadingImg1" src="
    data:image/png;base64,
    " alt="loadingImg1">

    <!-- <img class="loadingImg1" v-if="currentWidth<1440" src="../assets/loading2.png" alt=""> -->




    <img v-if="currentWidth>=1440" class="pcLoading" src="
    data:image/png;base64,
    ">



    <!-- <img v-if="currentWidth>=1440" class="pcLoading" src="
    data:image/gif;base64,
    " alt=""> -->



      <p class="enterBtn" v-if="percentage >= 92" @click="closeCurrentLoading()"></p>


    <div class="bottomCon">

      <img v-if="currentWidth<1440" class="loadingImg2" src="
      data:image/gif;base64,
      " alt="loadingGif">

      <!-- <img v-if="currentWidth<1440" class="loadingImg2" src="../assets/loading2.gif" alt=""> -->
      <p class="loadingP1">... {{percentage}}%</p>
      <p class="loadingP2">DESIGN INFINITE LIFE</p>
    </div>
  </div>
</template>

<script>
export default {
  props: {
    percentage: {
      type: Number,
      default: 0
    }
  },
  data(){
    return{
      currentWidth: document.body.clientWidth
    }
  },
  methods: {
    onResize(){
      this.currentWidth = document.body.clientWidth
    },
    closeCurrentLoading(){
      this.$parent.closeLoading()
    }
  },
  mounted(){
    window.addEventListener('resize', this.onResize)
    this.currentWidth = document.body.clientWidth
    if(this.currentWidth>=1440){
      this.$refs.loadingCon.style.background = 'black'
    }
  },
  beforeUnmount(){
    window.removeEventListener('resize', this.onResize)
  }
}
</script>

